import { Link, useNavigate } from 'react-router-dom';
import './Item.css';

function Item({ item }) {
  return (
    <Link to={item.id} className="item.link" ><tr className="item" key={item.id}>

    <td className="item__td">{item.firstName}</td>
    <td className="item__td">{item.lastName}</td>
    <td className="item__td">{item.email}</td>
    <td className="item__td">{item.role}</td>
  </tr></Link>

  );
}

export default Item;
